const Home = (props) => {
useEffect(() => {
  if(props.name=="Deleted")  {
    const { id } = useParams();   
    props.detailsList.splice(id,1);
  }
  }, []);


  return <h1>{props.name??"HOME"}</h1>;
};

export default Home;
